    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from January through April
    of 1954. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, predators, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments. The public relations section
    of the report describes recreational uses, Refuge participation, and fishing. Items
    of interest and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
